import React, { useContext } from 'react'
import { TodosContext } from '../context/TodosContext'

export default function AddTodo() {
  const { todos } = useContext(TodosContext)
  return (
    <div>
      {todos.map((todo) => <Todo />)}
    </div>
  )
}
